import { Box } from '@mui/material'

const MealDetails = ({ foods }) => {
  return (
    <Box sx={{ display: 'flex', flexDirection: 'column', border: 'solid 1px black' }}>
      <Box className="food-title">
        {
          foods.map((food) =>
            <div>{food}</div>
          )
        }
      </Box>
      <Box className='calorie'>

      </Box>
    </Box>
  )
}

export default MealDetails
